// Import elements
import {
    Banner,
    ArticleTitle,
} from './elements';

const ArticleInner = () => {
    return (
        <>
            <main>
                {/* Banner */}
                <Banner />

                {/* Article title */}
                <ArticleTitle>
                    The different forms of blockchain
                </ArticleTitle>
            </main>
        </>
    )
}

export default ArticleInner;
